// import logo from './logo.svg';
import './App.css';
import Form from './components/login/Form'
import card from './components/card'
import cards from './components/cards'
import mainDash from './components/mainDash'
import table from './components/table'
import Sidebar from './components/sidebar'
// import updates from './components/updates'
import { BrowserRouter as Router, Link,Redirect,Switch, Route, Routes } from "react-router-dom";
// import { SidebarData } from './Data/Data';
// import Sidebar from './components/Sidebar';


function App() {
  return (
    <div className="App">
      <Router>
      <Routes>

        <Switch>
        <Route exact path ='/' element={<Form/>} component={<Form/>} />
        <Route exact path ='/home' element={<Form/>} component={<Form/>} />

        <Route path="/login" component={login/Form} />
        <Route path="/sidebar" component={Sidebar/Form} />
        <Route path="/card" component={card/Form} />
        <Route path="/cards" component={cards/Form} />
        <Route path="/mainDash" component={mainDash/Form} />
        <Route path="/table" component={table/Form} />

        <Redirect to="/" />
        </Switch>


      </Routes>
    </Router>
    </div>
  );
}

export default App;
